let basic_visibiltyControl=function($object){basic_hiddenObjects.push($object);if(basic_hiddenControlTimer){basic_hiddenControlTimer=clearTimeout(basic_hiddenControlTimer)}
basic_hiddenControlTimer=setTimeout(function(){for(var i=0;i<basic_hiddenObjects.length;i++){basic_hiddenObjects[i].contElement.style.visibility="visible"}
basic_hiddenObjects=[]},basic_settings.show_hidden_objects_xms_later)}
let basic_autoAdder=function($object){try{for(var boxIndex in basic_boxes){for(var boxItemNames in basic_boxes[boxIndex]){if(basic_boxes[boxIndex][boxItemNames]==$object){if(basic_boxes[boxIndex].upperObject!=$object){basic_boxes[boxIndex].add($object)}}}}
if($object!=page){}}catch(e){}}
